    data: |
      SELECT DISTINCT + - 85 AS col0 FROM tab0 (FORMAT parquet) WHERE NOT + col0 * - + CAST ( - 94 AS REAL ) - + col1 * col2 + + ( - 74 ) + - - 89 IS NOT NULL;
  - name: tab0

outputs:
  - name: q13890.out
    data: |
